import React from 'react';
import {StyleSheet, Text, View, ScrollView, Image, TouchableWithoutFeedback} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import restauranteMenu from './RestauranteMenu';
import restaurantes from './Restaurantes';  


const Stack = createStackNavigator();
export default function Cart({navigation}) {
var restaurante = ' ';
var initR = 'Restaurantes';
if(navigation.state.params) {
    restaurante = navigation.state.params.restaurante;
    initR = 'Pratos';
    console.log(navigation)
    navigation.navigate(initR, {restaurante: restaurante});
    return(
        <NavigationContainer>
        <Stack.Navigator initialroute={'Pratos'}>
        <Stack.Screen name="Pratos" component={restauranteMenu} initialParams={{ restaurante: restaurante}}/>
        </Stack.Navigator>
        </NavigationContainer>

    );
}

else{
    return(
        <NavigationContainer>
        <Stack.Navigator initialroute={'Restaurantes'}>
        <Stack.Screen name="Restaurantes" component={restaurantes} initialParams={{ restaurante: restaurante}}/>
        <Stack.Screen name="Pratos" component={restauranteMenu} initialParams={{ restaurante: restaurante}}/>
        </Stack.Navigator>
        </NavigationContainer>

    );
}
}




const styles = StyleSheet.create({
    image: {
        height: 300,
    },
});
